import pandas as pd
from sklearn import linear_model as lm
import numpy as np

"""## Loading Data"""

df_raw = pd.read_csv('kc_house_data.csv')

df_raw.head(10)

"""## Data Preparation"""

# features
x_train = df_raw.drop(['price','date'], axis=1) #excluir price pq é a variavel resposta,axis para excluir as linhas da coluna
# response variable 
y_train = df_raw['price'].copy() # fazer uma copia por ser a variavel resposta :)

"""## Model Training """

# model description
model_lr = lm.LinearRegression()
# model training
model_lr.fit(x_train,y_train)

# prediction 
pred = model_lr.predict(x_train)

"""## Performance Metrics """

df1 = df_raw.copy()

df1 ['prediction'] = pred # fechar o ciclo, PRED é o modelo em treinamento

df1 [['id','price','prediction','error','error_abs','error_perc','error_perc_abs']].head()

df1['error'] = df1 ['price'] - df1['prediction']
df1 ['error_abs'] = np.abs(df1['error']) # termo abs é de absoluter

# fiz a subtração primeiro relacionando com o () ,para depois fazer a divisão.

df1 ['error_perc'] = ( ( df1 ['price'] - df1 ['prediction'] ) / df1 ['price'] ) #relativizar o erro em relação ao price,

#pra ter o valor de % e crio uma nova coluna .
# vou passar o paremetro abs para nao ficar percentual negativo.
df1 ['error_perc_abs'] = np.abs ( df1 ['error_perc' ])

np.sum ( df1 ['error_abs'] ) / len ( df1['error_abs'] ) # somar todos os erros e dividir pelos erros para conseguir a media

# outra forma de conseguir a media 
# mae =  mean absolute error 
mae = np.mean( df1['error_abs'])
print('MAE: {}'.format (mae))

# minha previsão ainda tem um erro de 25%
# mape = mean absolute percentage error
mape = np.mean( df1['error_perc_abs'])
print('MAPE: {}'.format (mape))

